import Button from '@restart/ui/esm/Button'
import React from 'react'
import { useHistory } from 'react-router'
import './Newhome.css'
import FOTO from './FOTO.png'
import { FaBeer } from 'react-icons/go';    

const Newhome = () => {
    
    let history = useHistory();

    class Question extends React.Component {
        render() {
          return <h3> Lets go for a <GoMarkGithub />? </h3>
        }
      }

    return (
        <><div className="body">
            <h1>Hoja de vida</h1>
            <div className="foto">
            <img className="FOTO" src= {FOTO}
              />
            <h3 className="nombre">Santiago Gil Ramirez</h3>
            </div>
        </div><Button onClick={() => history.push('/home')}>INICIO</Button></>
    )
}

export default Newhome
